  return (
    <Typography variant="body1">
      <Box
        onClick={() => handleClick()}
        sx={{
          cursor: 'pointer',
          letterSpacing: 4,
          mr: 3,
        }}
      >
        <b>日記</b>
      </Box>
    </Typography>
  )
}
